import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const colors = theme.palette.colors;

  return {
    container: {
      display: "flex",
      width: "100%",
      marginTop: "40vh",
      justifyContent: "center",
      alignItems: "center"
    },
    intro: {
      color: "white",
      fontFamily: "Arizonia",
      fontSize: "20px"
    }
  };
});
